import "./App.css";
import * as React from "react";
import Stack from "@mui/material/Stack";
import TextField from "@mui/material/TextField";
import Button from "@mui/material/Button";
import SendIcon from "@mui/icons-material/Send";

function Footer({ name }) {
  return (
    <footer class="footer">
      Designed & Developed by {name} (2&#x2764;&#xfe0f;24) Sri Vasavi Engg.
      College
    </footer>
  );
}

function App() {
  return (
    <>
      <div class="container-fluid">
        <h1 class="title">PhishDefender</h1>
        <div class="content">
          <p>
            Think before you click!
            <br />
            We wish you're not going to be a victim...
          </p>
          <Stack direction="row" spacing={2}>
            <TextField id="standard-basic" label="URL" variant="standard" />
            <Button variant="outlined" endIcon={<SendIcon />}>
              Submit
            </Button>
          </Stack>
        </div>
      </div>
      <Footer name={"Subhan Saheb Shaik"}></Footer>
    </>
  );
}

export default App;
